"?" @param name - User name
"?" @param email - User Mailbox
"!" User object created by @return User
* /
public User createUser(String name, String email) {
if (name == null || email == null) {
throw new IllegalArgumentException(" Name and email address cannot be empty ");
}

// Check if the mailbox already exists
boolean emailExists = users.values().stream()
.anyMatch(user -> user.getEmail().equals(email));

if (emailExists) {
throw new IllegalArgumentException(" Mailbox already exists ");
}

User user = new User(name, email);
user.setId(nextId++);
users.put(user.getId(), user);

System.out.println(" user Creation successful: "+ user.getName());
return user;
}

/ * *
